INSERT INTO `redcap_docs` VALUES (1,3,'2009-12-02','EXPORT_MYTESTDB_SITE_ADMIN_2009-12-02-12-16-27.DO',822,'application/octet-stream','clear\n\ninsheet study_id first_name last_name dob sex address phone_number work street using \"DATA_MYTESTDB_SITE_ADMIN_2009-12-02-12-16-27.CSV\", nonames\n\nlabel data \"DATA_MYTESTDB_SITE_ADMIN_2009-12-02-12-16-27.CSV\"\n\nlabel variable study_id \"Study ID\"\nlabel variable first_name \"First Name\"\nlabel variable last_name \"Last Name\"\nlabel variable dob \"Date of Birth\"\nlabel variable sex \"Gender\"\nlabel variable address \"Street, City, State, ZIP\"\nlabel variable phone_number \"Phone number\"\nlabel variable work \"Work\"\nlabel variable street \"Street\"\n\nlabel define sex_ 0 \"Female\" 1 \"Male\" \n\nlabel values sex sex_\n\n\n\ntostring dob, replace\ngen _date_ = date(dob,\"MDY\")\ndrop dob\nrename _date_ dob\nformat dob %dM_d,_CY\n\norder study_id first_name last_name dob sex address phone_number work street \ndescribe\n','Stata syntax file created by site_admin on 2009-12-02-12-16-27',NULL,1),(2,3,'2009-12-02','EXPORT_MYTESTDB_SITE_ADMIN_2009-12-02-12-16-27.R',689,'application/octet-stream','#Clear existing data and graphics\nrm(list=ls())\ngraphics.off()\n#Load Hmisc library\nlibrary(Hmisc)\n#Read Data\ndata=read.csv(\'DATA_WHMYTESTDB_SITE_ADMIN_2009-12-02-12-16-27.CSV\')\n#Setting Labels\n\nlabel(data$study_id)=\"Study ID\"\nlabel(data$first_name)=\"First Name\"\nlabel(data$last_name)=\"Last Name\"\nlabel(data$dob)=\"Date of Birth\"\nlabel(data$sex)=\"Gender\"\nlabel(data$address)=\"Street, City, State, ZIP\"\nlabel(data$phone_number)=\"Phone number\"\nlabel(data$work)=\"Work\"\nlabel(data$street)=\"Street\"\n#Setting Units\n\n\n#Setting Factors(will create new variable for factors)\ndata$sex.factor = factor(data$sex,levels=c(\"0\",\"1\"))\n\nlevels(data$sex.factor)=c(\"Female\",\"Male\")\n','R syntax file created by site_admin on 2009-12-02-12-16-27',NULL,1),(3,3,'2009-12-02','EXPORT_MYTESTDB_SITE_ADMIN_2009-12-02-12-16-27.SAS',1301,'application/octet-stream','proc delete data=_ALL_;\nrun;\n\ndata REDCAP;\n%let _EFIERR_ = 0;\ninfile \'DATA_MYTESTDB_SITE_ADMIN_2009-12-02-12-16-27.CSV\' delimiter = \',\' MISSOVER DSD lrecl=32767 firstobs=1 ; \n	informat study_id $500. ;\n	informat first_name $500. ;\n	informat last_name $500. ;\n	informat dob mmddyy10. ;\n	informat sex best32. ;\n	informat address $500. ;\n	informat phone_number $500. ;\n	informat work $500. ;\n	informat street $500. ;\n\n	format study_id $20. ;\n	format first_name $20. ;\n	format last_name $20. ;\n	format dob mmddyy10. ;\n	format sex best12. ;\n	format address $20. ;\n	format phone_number $20. ;\n	format work $20. ;\n	format street $20. ;\n\ninput\n		study_id $\n		first_name $\n		last_name $\n		dob\n		sex\n		address $\n		phone_number $\n		work $\n		street $\n;\nif _ERROR_ then call symput(\'_EFIERR_\',1);\nrun;\n\nproc contents;run;\n\n\ndata redcap;\n	set redcap;\n	label study_id=\'Study ID\';\n	label first_name=\'First Name\';\n	label last_name=\'Last Name\';\n	label dob=\'Date of Birth\';\n	label sex=\'Gender\';\n	label address=\'Street, City, State, ZIP\';\n	label phone_number=\'Phone number\';\n	label work=\'Work\';\n	label street=\'Street\';\n	run;\n\nproc format;\n	value sex_ 0=\'Female\' 1=\'Male\';\n	run;\n\ndata redcap;\n	set redcap;\n\n	format sex sex_.;\n	run;\n\nproc contents data=redcap;\nproc print data=redcap;\nrun;\nquit;','Sas syntax file created by site_admin on 2009-12-02-12-16-27',NULL,1),(4,3,'2009-12-02','DATA_MYTESTDB_SITE_ADMIN_2009-12-02-12-16-27.CSV',210,'application/csv','\"4f41782a828b1c0deccad490bf3fc734\",\"TestUser\",\"TULastName\",01/01/2009,1,\"\",\"\",\"\",\"\"\n\"c7a756122f80b63d742209801b0dde6b\",\"TestUser2\",\"LastName2\",03/03/2008,1,\"\",\"(123) 123-1233\",\"\",\"\"\n','Data export file created by site_admin on 2009-12-02-12-16-27',NULL,1),(5,3,'2009-12-02','DATA_WHMYTESTDB_SITE_ADMIN_2009-12-02-12-16-27.CSV',281,'application/csv','study_id,first_name,last_name,dob