91202153514,'site_admin','127.0.0.1','process_single.php','MANAGE','redcap_metadata','insert into redcap_metadata values (3, \'accept_emails\', NULL, \'demographics\', NULL, \'6\', NULL, NULL, \'radio\', \'Accept emails\', NULL, \'Your new REDCap database has been created and is ready to be accessed. You may now begin exploring your database and the many features available to you. Below are some instructions to help you get started.  First-time users If you are using REDCap for the first time, you may wish to explore the many modules in your database to become familiar with what your database is capable of. These modules can all be accessed using the links on the left-hand menu, and each page has instructional text describing its purpose and how to use it. Your database is currently in Development status, but when you are ready for official data collection (after building and testing your database), you may move it to Production status on the Modify Database Settings page. Also, you may grant other REDCap users access to your database by entering their username on the User Rights page and setting their privileges.  Building your database and creating data collection forms It is often the case that users begin by creating new data entry forms for their database on the Online Form Editor and Data Dictionary Upload page. On that page you may use the online method (Online Form Editor) to create new forms and add new database fields in real time, or you may choose the offline method (creating a Data Dictionary in Microsoft Excel and uploading it). Both methods may be used together in tandem, or you may use one method exclusively, if you wish. This database has already been pre-filled with some basic demographics fields to get you started. You may delete them or continue adding more database fields. You may create as many database fields and data collection forms as you like.  Re-using data entry forms and creating &quot;Events&quot; If you wish, you may use your data collection forms multiple times for any given database record, which is often the case when collecting longitudinal data where the same information might be entered numerous times. You may begin the process of setting this up in the database by creating new &quot;Events&quot; on the Define My Events page. The Events that you create will correspond to a visit or other temporal event in your project. Once your Events have been set up, if you have already created your data entry forms at this point, you will then need to designate which forms you wish to utilize for each of your Events. This is done on the Designate Forms for My Events page. Once you have completed this setup process, you may begin entering data on your data entry forms.\', NULL, NULL, NULL, NULL, NULL, \'0\')','accept_emails',NULL,'field_name = \'accept_emails\'','Create database field',0),(73,3,20091202153937,'site_admin','127.0.0.1','process_single.php','MANAGE','redcap_metadata','update redcap_metadata set field_name = \'accept_emails\', element_label = \'Accept emails\', field_req = \'0\', field_phi = NULL, element_note = \'By checking this box, I accept updates on future releases\', element_type = \'radio\', element_validation_type = NULL, element_validation_checktype = NULL, element_enum = NULL, element_validation_min = NULL, element_validation_max = NULL, branching_logic = NULL where project_id = 3 and field_name = \'accept_emails\'','accept_emails',NULL,'field_name = \'accept_emails\'','Edit database field',0),(74,3,20091202154118,'site_admin','127.0.0.1','process_single.php','MANAGE','redcap_metadata','update redcap_metadata set field_name = \'user_id\', element_label = \'User Id\', field_req = \'0\', field_phi = NULL, element_note = \'Your private user id for general sign in\', element_type = \'text\', element_validation_type = NULL, element_validation_checktype = \'soft_typed\', element_enum = NULL, element_validation_min = NULL, element_validation_max = NULL, branching_logic = NULL where proj